typedef struct MyStruct {
    int value; 
} MyStruct;
```

2. Create a .c file that implements functions that operate on that struct:

```c
MyStruct* createMyStruct() {
    MyStruct* s = malloc(sizeof(MyStruct));
    s->value = 0;
    return s; 
}

void deleteMyStruct(MyStruct* s) {
    free(s);
}

void setValue(MyStruct* s, int value) {
    s->value = value;
}
```

3. Build your C code into a .so library.

4. In your Kotlin class, declare a native pointer to the struct:

```kotlin
class MyClass {
    private external val myStruct: Long

    init {
        myStruct = createMyStruct()
    }
}
```

5. Use JNI to call the C functions and operate on the struct:

```kotlin
fun setValue(value: Int) {
    setValue(myStruct, value)
}

override fun finalize() {
    deleteMyStruct(myStruct)
}
```

6. The `myStruct` pointer will hold the internal state of the C struct, and you can operate on it from your Kotlin class.

So in summary, you define the C struct, functions, and library, expose a native pointer in Kotlin, and use JNI to call the C functions and manipulate the struct from your Kotlin class.

